textOriginal:
Por que mudar? O Bostonaro corrompeu quase todas as nossas instituicoes.  Precisamos fortalecê-las novamente. Nada impede que o Bostonaro seja cabdidato em 2026. No cenário atual, é importante a mudança para podermos estabilizar o País novamente.  Apenas para relembrar esse governo: 
- foram quase 700 mil mortes no Covid. Muitas em consequencia do negativismo e do uso inadequado de medicamentos sabidamente ineficaficazes ;
- tratamento dado as mulheres como se elas fossem Cidadãs de 2° classe:
- misturar religião com política.  O nosso Brasil deve continuar a ser um País laico. Os brasileiros devem ter o direito de professar livremente a sua fé;
- as nossas instituicoes democraticas precisam ser fotalecidas. Não podemos retroceder.  O Pais não suporta um regime autocratico;
- é hora de deixarmos de ser pária global . O Brasil para crescer precisa participar do ciclo global;
- ...
Se Você está em dúvida, vote pela saudável mudança. Não há nenhum impedimento que o atual Presidente retorne daqui a 4 anos. 
Reflita. Mude. O País conta contigo.  Viva o Brasil ❤️
